// 創建閩南語字典 字母1,數字1;字母2,數字2;
function parseData(data) {
    const dict = {};
    const arr = data.split(';');
	const pairs = [...new Set(arr)]; // 去除重複單字
    
    for (const pair of pairs) {
        const [word, code] = pair.split(',');
        dict[word] = parseInt(code);
    }    
    return dict;
}

// 創建詔安客語字典
//kasuMp3
kasuMp3 = kasuMp3.replace(/_/g, '-').replace(/-+/g, '-'); // 先將底線替換為連字符;
dictionaryKasu = parseDataKasu(kasuMp3);

function parseDataKasu(data) {
    const dict = {};
    const arr = data.split(/\s+/);
    const uniqueArr = [...new Set(arr)]; // 去除重複單字;
    for (const word of uniqueArr) {
        dict[word] = true;
    }
    return dict;
}